import React from 'react';
import '../styles/Resources.css';
import bitcointalk from '../media/images/bitcointalk.png';
import discord from '../media/images/discord.png';
import facebook from '../media/images/facebook.png';
import github from '../media/images/github.png';
import reddit from '../media/images/reddit.png';
import slack from '../media/images/slack.png';
import telegram from '../media/images/telegram.png';
import twitter from '../media/images/twitter.png';


const Resources = () => {
    return (
        <div className="res__container">
            <div className="res__options">

                <div className="res__info">
                    <div><strong>More Resources</strong></div>
                    <ul>
                        <li> <a href="#">Cryptoid Explorer</a> </li>
                        <li> <a href="#">Myralicious Explorer</a> </li>
                        <li> <a href="#">Simple Statistics</a> </li>
                        <li> <a href="#">Active Miners</a> </li>
                    </ul>
                </div>

                <div className="res__social">
                    <ul>
                        <li> <a href="#"> <img className="res__icons" src={bitcointalk} alt="logo"/> </a> </li>
                        <li> <a href="#"> <img className="res__icons" src={discord} alt="logo"/> </a> </li>
                        <li> <a href="#"> <img className="res__icons" src={facebook} alt="logo"/> </a> </li>
                        <li> <a href="#"> <img className="res__icons" src={github} alt="logo"/> </a> </li>
                        <li> <a href="#"> <img className="res__icons" src={reddit} alt="logo"/> </a> </li>
                        <li> <a href="#"> <img className="res__icons" src={slack} alt="logo"/> </a> </li>
                        <li> <a href="#"> <img className="res__icons" src={telegram} alt="logo"/> </a> </li>
                        <li> <a href="#"> <img className="res__icons" src={twitter} alt="logo"/> </a> </li>
                    </ul>
                </div>
            </div>


            <div className="res__footer">
                &copy; 2021 Myriad
            </div>
        </div>
    )
}

export default Resources
